import React from 'react'
import './asset/main.scss'
import Header from './components/Header'
import ListItem from './components/ListItem'
import Footer from './components/Footer'
class App extends React.Component {
  constructor(props) {
    super(props)
    this.state = {
      todoList: [{
        id: 1,
        text: 'todo 1',
        isCompleted: true
      },
      {
        id: 2,
        text: 'todo 2',
        isCompleted: false
      },
    ]
    }
  }
  render() {

    return (
        <div>
          <Header />
          <ListItem />
          <Footer/>
        </div>
    )
  }
}

export default App
